import React from 'react'
import './../Style/Partner.css'

function Partner() {
    return (
        <div className='partner-container'>
            <div className='partner-box'>
            <img src='https://yt3.ggpht.com/ytc/AKedOLR1nhyHDVLxQ1qDFBtiXI7j68m236LlXvv3FMYC=s900-c-k-c0x00ffffff-no-rj' className='partner-img'/>


            </div>
        </div>
    )
}

export default Partner
